import * as React from "react";

import {View} from 'react-native';

function MouseClicked(cartTotalQuantity) {
    const totalQuantity=cartTotalQuantity;

    return(
        <View>
            <Text>"{cartTotalQuantity}"</Text>
        </View>
    );

}

export default MouseClicked;
